  false,\n\t\"url\": null,\n\t\"notes\": \"To combat lead poisoning through the Childhood
  Lead Poisoning Prevention and Healthy Homes Program, the Chicago Department of Public
  Health (CDPH) works to enforce city and state laws regarding lead paint by dispatching
  building inspectors to identify lead hazards in homes and apartments and hold property
  owners accountable for making repairs required by law.  This metric tracks the total
  number of initial lead inspections CDPH performs per month.  The performance goal
  is 100 inspections per month.  For more information about CDPHu2019s lead poisoning
  prevention programs, or to report elevated blood lead levels, see the Environmental
  Health Division at http://www.cityofchicago.org/city/en/depts/cdph/provdrs/environ_health.html\",\n\t\"license_title\":
